import React from 'react';
import styles from './Book5Anim.module.css';

const Book5 = () => {
    return (
        <div id="card">
            <div class={styles.container}>
                <div class={styles.door5}></div>
                <p>5</p>
            </div>
        </div>
    );
};

export default Book5;
